/* For page Planned task*/
/*contains
earlier ,today ,later
*/
import React from "react";
import "../CSS/planned.css";
import "../App.css";
import { Task } from "../components/task.tsx";

interface taskprop {
  name: String;
  dueDate: Date;
  important: boolean;
  repeat: boolean;
  completed: boolean;
  taskID: String;
}

interface planedProp {
  today: taskprop[];
  tommorow: taskprop[];
  previous: taskprop[];
}

export function Planned({ today, tommorow, previous }: planedProp) {
  const plannedIcon = require("../Images/sidebar-box.png");

  return (
    <div className="planned">
      <div className="planned-heading">
        <img src={plannedIcon} alt="planned"></img>
        <div>Planned</div>
      </div>
      <br />
      <br />
      <div className="planned-parts">
        <div className="planned-parts-head">Today 1</div>
        <div>
          {today.map((obj, index) => (
            <Task {...obj} />
          ))}
        </div>
      </div>
      <br />
      <br />
      <div className="planned-parts">
        <div className="planned-parts-head">Tommorow 1</div>
        <div>
          {tommorow.map((obj, index) => (
            <Task {...obj} />
          ))}
        </div>
      </div>
      <br />
      <br />
      <div className="planned-parts">
        <div className="planned-parts-head">Previous 1</div>
        <div>
          {previous.map((obj, index) => (
            <Task {...obj} />
          ))}
        </div>
      </div>
    </div>
  );
}
